Detour #5:  Marathon miles 8 + 9:  Piedmont
&lt;br&gt;&lt;/br&gt;

&lt;i&gt;From 8:00am to 10:15am:&lt;/i&gt;  To get to Montclair Village, head up Moraga to Highway 13 southbound, exit at Joaquin Miller/Lincoln, take left over Highway 13, left on Mountain Blvd. to return to Village. Or take a left back to Highway 13 northbound to get to Highway 24 or I-580. 
&lt;br&gt;&lt;/br&gt;

&lt;i&gt;Of special note:&lt;/i&gt;  Vehicles coming from the Piedmont side of La Salle will need to turn right on Estates to Park Blvd. and then down to I-580 OR left on Estates to Moraga.  
&lt;br&gt;&lt;/br&gt;

&lt;i&gt;After 10:15am:&lt;/i&gt; Runners will have cleared area; streets will be reopened to normal traffic.
